    <div className = "main">
    <div className = "ContenedorSaludo">
      <ul>
        <li className = "ListaSaludo" style= {{color:`${props.color}`}}>{props.saludo}</li>
      </ul>
    </div>

    <div className = "ContenedorProductos">

    <ItemList/>

    </div> 
  </div>


  )
};

